import React from "react";
import styled from "styled-components";
import { SubTitle } from "../../../elements";

const Card = styled("div")`
width:150px;
height:150px;
position:relative;
box-shadow: 1px 1px 10px rgba(0, 0, 0, 0.161);
margin-right:30px;
margin-bottom:60px;
`;
const Container = styled("div")`
display:flex;
margin-top:20px;
`;
const SubTitleWithSpace = styled(SubTitle)`

padding-bottom:10px;
`;



const CenteredElement = styled("div")`
position: absolute;
  top: 50%;
  left: 50%;
  transform: translate(-50%, -50%);
  font-family: Open Sans;
font-style: normal;
font-weight: bold;
font-size: 14px;
line-height: 19px;
color: #444444;
`;



const Document = () => {
    return (
        <>
            <Container>
                <div>
                    <SubTitleWithSpace>Front view</SubTitleWithSpace>
                    <Card>
                        <CenteredElement>
                            + Upload
            </CenteredElement>

                    </Card>
                </div>
                <div>
                    <SubTitleWithSpace>Side view</SubTitleWithSpace>
                    <Card>
                        <CenteredElement>
                            + Upload
            </CenteredElement>
                    </Card>
                </div>
            </Container>
        </>
    );
}



export default Document;
